const audio = new Audio();
document.body.append(audio);
audio.addEventListener("loadeddata", () => {
    const f = () => {
        setTimeout(() => {
            audio.currentTime = 0;
            audio.play();
            f();
        }, Math.random() * 60_000);
    };
    audio.play();
    f();
}, {once: true});
audio.src = `data:audio/mpeg;base64,`;